        "    k = 2 ** (len(config) - 1) + 1\n",
        "    X, Y = (np.vstack([[(0, 0)], np.asarray(config).cumsum(axis=0)])[:-1].T - 0.5)\n",
        "    U, V = np.asarray(config).T\n",
